import React from "react";
import { Link } from "react-router-dom";
import { connect } from "react-redux";
import { Col, Container, Row, Card, CardText, CardBody,CardTitle,CardSubtitle,Button } from "reactstrap";
const Intro = () => (
  <section className="pt-8 pb-11 pt-md-9 pb-md-12 py-lg-14 bg-light bg-between" >
    <div className="container">
      <div className="row justify-content-center">
        <div className="col-12 col-md-10 col-lg-7 text-center" data-aos="fade-up">


          <img src="" alt="..." className="img-fluid mb-6 d-lg-none"/>


          <h1 className="display-2 font-weight-bold">
            Designed secure.
            Built for anything.
          </h1>


          <p className="font-size-lg text-muted mb-6 mb-md-8">
            Forward thinking businesses use our cloud backup service to ensure data reliability and safety.
          </p>


          <a href="#!" className="btn btn-primary mr-1 lift">
            Get started <i className="fe fe-arrow-right ml-3"></i>
          </a>
          <a href="#!" className="btn btn-primary-soft lift">
            Learn more
          </a>

        </div>
      </div>
    </div>
  </section>
);

const Footer = () => (
  <section classNameName="py-5">
    <Container classNameName="text-center">
      <Row>
        <Col md="9" lg="8" xl="6" classNameName="mx-auto">
          <h2 classNameName="h1 mb-3">
            Join over 2,500 developers who are already working with our products
          </h2>
          <Button
            color="primary"
            size="lg"
            href="https://themes.getbootstrap.com/product/appstack-react-admin-dashboard-template/"
            target="_blank"
            rel="noopener noreferrer"
          >
            Purchase
          </Button>
        </Col>
      </Row>
    </Container>
  </section>
);

class Landing extends React.Component {

  render() {
    return (
      <React.Fragment>
        {/* <Navigation />*/}
        <Intro />

        {/*<Footer />*/}
      </React.Fragment>
    );
  }
}

export default connect()(Landing);
